import React from 'react'
import ReactDOM from 'react-dom'
import Part from './part';

const Content = (props) => {
    <>
        <Part part = {props.part1} course = {props.exercise1}/>
        <Part part = {props.part2} course = {props.exercise2}/>
        <Part part = {props.part3} course = {props.exercise3}/>
    </>
}

export default Content;
